import React from 'react';

function Add(x,y)
{
let z = x+y;
return (z);
}

function Sub(x,y)
{
let z = x-y;
return (z);
}

function Mul(x,y)
{
let z = x*y;
return (z);
}


function Divi(x,y)
{
let z = x/y;
let s = z.toFixed(2)
return (s);
}
export {Add,Sub,Mul,Divi};
